import React from "react";
import "./Sidebar.css";

const Sidebar = () => {
  return (
    <div className="Sidebar pointer">
      <div className="sidebar__items top__menu__icons d__flex align__items__center justify__content__center ">
        <svg
          viewBox="0 0 24 24"
          preserveAspectRatio="xMidYMid meet"
          focusable="false"
          class="style-scope yt-icon"
          style={{height:"30px",width:"30px"}}
        >
          <g class="style-scope yt-icon">
            <path
              d="M4,10V21h6V15h4v6h6V10L12,3Z"
              class="style-scope yt-icon mx-5"
            ></path>
          </g>
        </svg>
      </div>
    </div>
  );
};

export default Sidebar;
